const Input = () => (
    <div>
    <textarea rows="5" cols="30" id = "txtArea"> </textarea>
    <input type = "button" value="click here" onclick = "getText();" />
    </div>
);
function getText() {
  var area = document.getElementById("txtArea");
  str = area.value // here we got value
  alert(str + " i did it");
}
export default Input;
